@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM a rdfs:Class .
atm:Account a rdfs:Class .
atm:Bank a rdfs:Class .
atm:CashCard a rdfs:Class .
atm:Customer a rdfs:Class .

atm:ownsCard a rdf:Property ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:CashCard .

atm:belongsToBank a rdf:Property ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:hasAccount a rdf:Property ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Account .

atm:cardIssuedBy a rdf:Property ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Bank .

atm:ValidCashCard a owl:Class ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:ownsCard ;
                          owl:someValuesFrom atm:CashCard ] .

atm:ValidPassword a owl:Class .

atm:ProblemWithAccount a owl:Class ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:hasAccount ;
                          owl:someValuesFrom atm:Account ] .

atm:BankMessage a owl:Class ;
    owl:equivalentClass [ a owl:Restriction ;
                          owl:onProperty atm:belongsToBank ;
                          owl:someValuesFrom atm:Bank ] .

atm:ATM a owl:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
                      owl:onProperty atm:belongsToBank ;
                      owl:someValuesFrom atm:BankMessage ] .

atm:Bank a owl:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
                      owl:onProperty atm:cardIssuedBy ;
                      owl:someValuesFrom atm:ValidCashCard ] .

atm:Customer a owl:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
                      owl:onProperty atm:hasAccount ;
                      owl:someValuesFrom atm:ProblemWithAccount ] .
